import React from 'react';
import s from './Skills.module.css';

function Skills() {
    return (
        <div >
            <span id={s.work}>Ինչ եմ անում ես</span>
            <br />
            <br />
            <span id={s.about_me}>Genius, Billioner, Playboy, Philantropist</span>
            <br />
            <img src="" alt="" />
            <div className={s.languages}>
            <img id={s.html} src="https://upload.wikimedia.org/wikipedia/commons/thumb/3/38/HTML5_Badge.svg/600px-HTML5_Badge.svg.png" alt="" />
            <img id={s.css} src="https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/Devicon-css3-plain.svg/2048px-Devicon-css3-plain.svg.png" alt="" />
            <img id={s.js} src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Unofficial_JavaScript_logo_2.svg/1200px-Unofficial_JavaScript_logo_2.svg.png" alt="" />
            <img id={s.jquery} src="https://avatars.githubusercontent.com/u/70142?s=200&v=4" alt="" />
            <img id={s.react} src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/47/React.svg/1200px-React.svg.png" alt="" />
            <br />
            <span id={s.l}>HTML CSS JavaScript jQuery React</span>
            </div>
        </div>
    );
}

export default Skills;
